
input = ""

def find_uniq_chars(input, target_length):
    for i in range(target_length, len(input)):
        if len(set(input[(i-target_length):i])) == target_length:
            return i
    return -1

print("packet starts at ", find_uniq_chars(input, 4))
print("message starts at ", find_uniq_chars(input, 14))
